import React, { Component } from 'react';
import { Map, GoogleApiWrapper } from 'google-maps-react';
import './Map.css'

const mapStyles = {
  height: "100%",
  width: "100%",
  position: 'static !important',
};

export class MapContainer extends Component {
  render() {

  var ne = new this.props.google.maps.LatLng({ lat: this.props.north, lng: this.props.east })
  var sw = new this.props.google.maps.LatLng({ lat: this.props.south, lng: this.props.west })
  var bounds = new this.props.google.maps.LatLngBounds(sw,ne);

    return (
      <div id="mapContainer">
      <Map
        google={this.props.google}
        zoom= {12}
        style={mapStyles}
        center={{
         lat: this.props.lattitude,
         lng: this.props.longitude
        }}
        bounds={bounds}
      />
      </div>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyD8UWoPDZssIjtLLe_ogggrymmRyrg_71E'
})(MapContainer);
